function IndividualExplanationContainer() {
  return (
    <div>
      <p>System behavior that results from the interplay of components and does not depend on the internals of those components.</p>
      <div className="explanationAttribution">
        <p>@albert</p>
      </div>
    </div>
  )
}

export default IndividualExplanationContainer;
